import React from 'react';
//import '../Styles/Navbar.css';
import { NavLink } from 'react-router-dom';
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import "../node_modules/bootstrap/dist/js/bootstrap.bundle";


const Navbar = () => {
  return (
    <>



      <nav className="navbar navbar-expand-lg navbar-light bg-light">
        <div className="container-fluid">
          <NavLink exact className="navbar-brand brand_name" to="/">ShrutiSrivastava</NavLink>
          <button className="navbar-toggler" type="button" data-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul className="navbar-nav ml-auto mb-2 mb-lg-0">
              <li className="nav-item">
                <NavLink activeClassName="menu_active" className="nav-link active" exact aria-current="page" to="/">Home</NavLink>
              </li>
              <li className="nav-item">
                <NavLink activeClassName="menu_active" className="nav-link " aria-current="page" to="/about">About</NavLink>
              </li>


              <li className="nav-item">
                <NavLink activeClassName="menu_active" className="nav-link" to="/project">Project</NavLink>
              </li>
              <li className="nav-item">
                <NavLink activeClassName="menu_active" className="nav-link" to="/contact">Contact</NavLink>
              </li>
            </ul>

          </div>
        </div>
      </nav>


    </>

  );
};

export default Navbar;
